import React from "react";

const Butttons = (props) => {
  return (
    <div id="buttons-container">
      {props.id}
      {props.id.forEach((element, i) => {
        return (
          <button id={element} value={props.value[i]}>
            {props.value[i]}
          </button>
        );
      })}
    </div>
  );
};

export default Butttons;
